import React from "react";
import styles from './video_item.module.css'

const VideoItem = ({video}) => (
  <li>
    <img src={video.POSTER} alt="poster" />
    <div>
        <p>{video.TITLE_KR}</p>
        <p>{video.video.GENRE}</p>
    </div>
  </li>
);

export default VideoItem;
